jobInfo.postDescription:
职责:
1.在项目经理领导下开展项目实施工作，确保项目计划、质量符合目标要求;
⒉.负责公司产品及系统的安装部署、升级维护;
3.公司产品及系统的功能需求调研、分析、设计;
4.负责用户培训，编写培训文档，解答用户系统使用过程中的疑问;
5.编写相关的实施文档、使用手册、测试文档、验收文档等。
任职资格:
1.本科及以上学历，计算机、软件相关专业，两年以上项目实施工作经验;
⒉熟悉ORACLE和MYSQL数据库及其他主流数据库，熟悉SQL语句编写;
3.熟练操作UNIX、LINUX服务器，常用中间件产品TOMCAT，WEBLOGIC等配置部署;
4.熟练使用shell或Python语言;
5.熟悉JAVA代码，对JAVA有所了解;
6.独立清晰的分析判断能力，逻辑思考能力和自主学习能力;
7.熟悉软件业务知识背景，具备良好的沟通技巧，高度的责任心及独立解决问题的能力;
8.有项目管理经验者优先。
